import { CircularProgressbar, buildStyles } from 'react-circular-progressbar';
import 'react-circular-progressbar/dist/styles.css';
import { Menu, MenuButton, MenuItems } from '@headlessui/react'
import { ChevronDownIcon } from '@heroicons/react/20/solid'
import { useState } from 'react';

interface CategoryCounts {
    scope: number;
    software: number;
    payment: number;
    dataSec: number;
    sla: number;
    own: number;
    contractDuration: number;
    exit: number;
    legal: number;
    compliance: number;
    cost: number;
  }

interface NavbarProps {
    avgScore: number;
    tick: number;
    cross: number;
    question: number;
    Compliance1: string;
    Exit1: string;
    Cost1: string;
    Sla1: string;
    Exit2: string;
    Cost2: string;
    ContractDuration1: string;
    Payment1: string;
    Compliance2: string;
    Scope1: string;
    DataSec1: string;
    ContractDuration2: string;
    Software1: string;
    Own1: string;
    Sla2: string;
    Scope2: string;
    DataSec2: string;
    Legal1: string;
    Legal2: string;
    Own2: string;
    Payment2: string;
    Software2: string;
    counts: CategoryCounts;
}

function Sidebar({
    avgScore,
    tick,
    cross,
    question,
    Compliance1,
    Exit1,
    Cost1,
    Sla1,
    Exit2,
    Cost2,
    ContractDuration1,
    Payment1,
    Compliance2,
    Scope1,
    DataSec1,
    ContractDuration2,
    Software1,
    Own1,
    Sla2,
    Scope2,
    DataSec2,
    Legal1,
    Legal2,
    Own2,
    Payment2,
    Software2,
    counts,
}: NavbarProps) {


    //Values for Classes, Circular Progressbar




    let tickValue = 0;
    if (tick) {
        tickValue = tick;
    }
    let crossValue = 0;
    if (cross) {
        crossValue = cross;
    }

    let questionValue = 0;
    if (question) {
        questionValue = question;
    }

    let value = 0;
    if (avgScore) {
        value = avgScore;
    } 


    //State for Infobutton

    const [info, hoverInfo] = useState(false);

    const InfoBox = async () => {
        hoverInfo((state) => !state);
    }



    return (
        <>

        {/* Sidebar */}
        <div className="flex justify-center w-96 bg-white h-full">
            <div className="flex flex-col">
                <div className="flex justify-center">
                    <h1 className="mt-8 ml-10 text-xl font-bold">Dashboard</h1>
                    <button className="mt-7" onClick={InfoBox} >
                        <img src="/ex.png" alt="Question Icon" className="w-9 h-9"></img>
                    </button>
                </div>

                {/* Infocare / Only when hovering over button */}
                {info && (<div  className="flex items-center mt-4 mb-4  bg-primary text-white text-sm font-bold px-4 py-3" role="alert">
                        <p>The information provided here is intended solely as assistance and does not constitute legally binding advice from a licensed attorney.</p>
                </div>)}

                {/* Mini Dashboard */}
                <div className="flex justify-center">
                    <div className="mt-5 bg-white w-80 h-32 rounded-lg shadow-md border border-primary-2">
                        <div className="flex flex-grow justify-between ">
                            {/* Left Dashboard */}
                            <div className="flex flex-col ml-10">
                                <div className="flex mt-6">
